script: |
  super -f text -I q7973.spq | sort > q7973.out

inputs:
  - name: q7973.spq
    data: |
      SELECT DISTINCT + - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE + + 9 NOT IN ( 19, col1 + + 85, - 42 * + col1 * - + col1, + + col1 );
  - name: tab0

outputs:
  - name: q7973.out
    data: |
      -10
      -47
      -99
